How PSK / TLS Key is Calculated:

Insert "ICCID"(20 Characters - 10 bytes);
Insert "Master Key"(32 Characters - 16 bytes);
Click in "Calculate" button.

data(20 Characters - 10 bytes) = swapped ICCID e.g ABCDEFGHIJ -> BADCFEHGJI;
KM0(32 Characters - 16 bytes) = First 8 bytes(Master Key) + Last 8 bytes(Master Key);
KM1(32 Characters - 16 bytes) = Last 8 bytes(Master Key) + First 8 bytes(Master Key);
r1(16 Characters - 8 bytes) = Encrypted "data" with Triple DES ECB NO_PADDING using "KM0" as a Key;
r2(16 Characters - 8 bytes) = Encrypted "data" with Triple DES ECB NO_PADDING using "KM1" as a Key.

PSK / TLS Key(32 Characters - 16 bytes) = r1 + r2

